Saludos, Invocadores:
Hoy a la tarde jugando una partida con{{champion:11}} jungla me hice un pentakill y ganamos la partida. Todo iba bien hasta que le doy al boton de &quot;continuar&quot; y soy enviado directamente al inicio, osea que no pude dar honores, no pude ver mis estadisticas ni ver si me saque una S o una A o una caja, es mas,  la partida jamas existio pues no aparece en mi historial, algun  rioter que se presente para arreglar esto porfis.

GRACIAS!{{sticker:vlad-salute}}
